

/*******************************************************************************
   Create Tables
********************************************************************************/

/*Entity*/
DROP TABLE IF EXISTS AppPermission CASCADE;
create table AppPermission (
	PermissionId SERIAL NOT null,
    Name VARCHAR(120),
    CONSTRAINT PK_Permission PRIMARY KEY (PermissionId)
);

/*Entity*/
DROP TABLE IF EXISTS AppRole CASCADE;
create table AppRole (
	RoleId SERIAL NOT null,
    Name VARCHAR(120),
    CONSTRAINT PK_Role PRIMARY KEY (RoleId)
);

/*Entity PENDIENTE DE REVISAR ON DELETE*/
DROP TABLE IF EXISTS AppUser CASCADE;
create table AppUser(
	UserId SERIAL not null,
	UserName VARCHAR(40) NOT NULL,
	Password VARCHAR(40) NOT NULL,
	FirstName VARCHAR(40) NOT NULL,
    LastName VARCHAR(20) NOT NULL,
    City VARCHAR(40),
    State VARCHAR(40),
    Country VARCHAR(40),
    PostalCode VARCHAR(10),
    Phone VARCHAR(24),
    Email VARCHAR(60) NOT null,
    RoleId INT not null DEFAULT 4,
    UNIQUE(UserName),
    FOREIGN KEY (RoleId) REFERENCES AppRole (RoleId) ON DELETE SET DEFAULT ON UPDATE NO ACTION,
    CONSTRAINT PK_User PRIMARY KEY (UserId)
);


/*Entity*/
DROP TABLE IF EXISTS RolePermission CASCADE;
create table RolePermission(
	RoleId INT NOT NULL,
    PermissionId INT NOT NULL,
    CONSTRAINT PK_RolePermission PRIMARY KEY (RoleId, PermissionId),
    FOREIGN KEY (RoleId) REFERENCES AppRole (RoleId) ON DELETE CASCADE ON UPDATE NO ACTION,
    FOREIGN KEY (PermissionId) REFERENCES AppPermission (PermissionId) ON DELETE CASCADE ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS Artist CASCADE;
CREATE TABLE Artist
(
    ArtistId INT NOT NULL,
    Name VARCHAR(120),
    CONSTRAINT PK_Artist PRIMARY KEY (ArtistId)
);

DROP TABLE IF EXISTS Album CASCADE;
CREATE TABLE Album
(
    AlbumId INT NOT NULL,
    Title VARCHAR(160) NOT NULL,
    ArtistId INT NOT NULL,
    CONSTRAINT PK_Album PRIMARY KEY (AlbumId),
    FOREIGN KEY (ArtistId) REFERENCES Artist (ArtistId) ON DELETE CASCADE ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS Employee CASCADE;

DROP TABLE IF EXISTS Customer CASCADE;

DROP TABLE IF EXISTS Genre CASCADE;
CREATE TABLE Genre
(
    GenreId INT NOT NULL,
    Name VARCHAR(120),
    CONSTRAINT PK_Genre PRIMARY KEY (GenreId)
);

DROP TABLE IF EXISTS Invoice CASCADE;
CREATE TABLE Invoice
(
    InvoiceId INT NOT NULL,
    UserId INT NOT NULL,
    InvoiceDate TIMESTAMP NOT NULL,
    BillingAddress VARCHAR(70),
    BillingCity VARCHAR(40),
    BillingState VARCHAR(40),
    BillingCountry VARCHAR(40),
    BillingPostalCode VARCHAR(10),
    Total NUMERIC(10,2) NOT NULL,
    CONSTRAINT PK_Invoice PRIMARY KEY (InvoiceId),
    FOREIGN KEY (UserId) REFERENCES AppUser (UserId) ON DELETE NO ACTION ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS MediaType CASCADE;
CREATE TABLE MediaType
(
    MediaTypeId INT NOT NULL,
    Name VARCHAR(120),
    CONSTRAINT PK_MediaType PRIMARY KEY (MediaTypeId)
);

DROP TABLE IF EXISTS Track CASCADE;
CREATE TABLE Track
(
    TrackId INT NOT NULL,
    Name VARCHAR(200) NOT NULL,
    AlbumId INT,
    MediaTypeId INT NOT NULL,
    GenreId INT,
    Composer VARCHAR(220),
    Milliseconds INT NOT NULL,
    Bytes INT,
    UnitPrice NUMERIC(10,2) NOT NULL,
	Uri VARCHAR (300) DEFAULT NULL,
    Image VARCHAR (300) DEFAULT NULL,
    CONSTRAINT PK_Track PRIMARY KEY (TrackId),
    FOREIGN KEY (AlbumId) REFERENCES Album (AlbumId) ON DELETE CASCADE ON UPDATE NO ACTION,
    FOREIGN KEY (GenreId) REFERENCES Genre (GenreId) ON DELETE CASCADE ON UPDATE NO ACTION,
    FOREIGN KEY (MediaTypeId) REFERENCES MediaType (MediaTypeId) ON delete NO ACTION ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS PlaybackRecord;
CREATE TABLE PlaybackRecord(
    PlaybackRecordId SERIAL NOT NULL,
    UserId INT NOT NULL,
    TrackId INT NOT NULL,
    PlaybackDate TIMESTAMP NOT NULL DEFAULT NOW(),
    CONSTRAINT PK_PlaybackRecord PRIMARY KEY (PlaybackRecordId),
    FOREIGN KEY (UserId) REFERENCES AppUser (UserId) ON DELETE CASCADE ON UPDATE NO ACTION,
    FOREIGN KEY (TrackId) REFERENCES Track (TrackId) ON DELETE CASCADE ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS InvoiceLine CASCADE;
CREATE TABLE InvoiceLine
(
    InvoiceLineId INT NOT NULL,
    InvoiceId INT NOT NULL,
    TrackId INT NOT NULL,
    UnitPrice NUMERIC(10,2) NOT NULL,
    Quantity INT NOT NULL,
    CONSTRAINT PK_InvoiceLine PRIMARY KEY (InvoiceLineId),
    FOREIGN KEY (InvoiceId) REFERENCES Invoice (InvoiceId) ON DELETE NO ACTION ON UPDATE NO ACTION,
    FOREIGN KEY (TrackId) REFERENCES Track (TrackId) ON DELETE NO ACTION ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS Playlist CASCADE;
CREATE TABLE Playlist
(
    PlaylistId INT NOT NULL,
    Name VARCHAR(120),
    CONSTRAINT PK_Playlist PRIMARY KEY (PlaylistId)
);

DROP TABLE IF EXISTS PlaylistTrack CASCADE;
CREATE TABLE PlaylistTrack
(
    PlaylistId INT NOT NULL,
    TrackId INT NOT NULL,
    CONSTRAINT PK_PlaylistTrack PRIMARY KEY (PlaylistId, TrackId),
    FOREIGN KEY (PlaylistId) REFERENCES Playlist (PlaylistId) ON DELETE CASCADE ON UPDATE NO ACTION,
    FOREIGN KEY (TrackId) REFERENCES Track (TrackId) ON DELETE CASCADE ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS InactiveTrack CASCADE;
CREATE TABLE InactiveTrack
(
    TrackId INT NOT NULL,
    FOREIGN KEY (TrackId) REFERENCES Track(TrackId) ON DELETE CASCADE ON UPDATE NO ACTION
);
DROP TABLE IF EXISTS TrackHistory CASCADE;
/* Que pasa si se eliminA TrackId?*/
CREATE TABLE TrackHistory
(
    UserId INT NOT NULL,
    TrackId INT NOT NULL,
    FOREIGN KEY (UserId) REFERENCES AppUser(UserId)  ON DELETE CASCADE ON UPDATE NO ACTION,
    FOREIGN KEY (TrackId) REFERENCES Track(TrackId) ON DELETE CASCADE ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS LogBook CASCADE;
CREATE TABLE LogBook
(
    LogBookId SERIAL NOT NULL,
    UserId INT,
    Action VARCHAR(20) NOT NULL,
    itemId INT NOT NULL,
    recordDate TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL,
    Type VARCHAR(20) NOT NULL,
    CONSTRAINT PK_LogBook PRIMARY KEY (LogBookId),
    FOREIGN KEY (UserId) REFERENCES AppUser(UserId)  ON DELETE CASCADE ON UPDATE NO ACTION
);

