/* Statistics functions */
drop function if exists getSalesPerWeek;
CREATE OR REPLACE FUNCTION getSalesPerWeek(initial_date TEXT, final_date TEXT)
    RETURNS TABLE ( year DOUBLE PRECISION
    				,week_of_year DOUBLE PRECISION
                    , sales INTEGER) AS
$func$
BEGIN
    RETURN QUERY
    select
    date_part('year', invoicedate::date) as year,
    date_part('week', InvoiceDate::date) AS weekly, 
    COUNT(*)::INTEGER as sales           
    FROM invoice
    where InvoiceDate >= to_timestamp(initial_date, 'YYYY.MM.DD') and InvoiceDate <= to_timestamp(final_date, 'YYYY.MM.DD')
    GROUP BY year, weekly
    ORDER BY year, weekly;
END;
$func$  
LANGUAGE plpgsql;

--SELECT * FROM getSalesPerWeek('2009/1/28','2010/2/28');


drop function if exists getProfitableArtists;
CREATE OR REPLACE FUNCTION getProfitableArtists(initial_date TEXT, final_date TEXT, results_limit INT)
    RETURNS TABLE ( name VARCHAR
                    , sales INTEGER) AS
$func$
BEGIN
    RETURN QUERY
    SELECT Artist.name,
    COUNT(*)::INTEGER as sales           
    FROM Artist 
    INNER JOIN
    Album ON Album.ArtistId = Artist.ArtistId
    INNER JOIN
    Track ON Track.AlbumId = Album.AlbumId
    INNER JOIN
    InvoiceLine ON InvoiceLine.TrackId = Track.TrackId
    INNER JOIN
    Invoice ON Invoice.InvoiceId = InvoiceLine.InvoiceId
    
    WHERE InvoiceDate >= to_timestamp(initial_date, 'YYYY.MM.DD') and InvoiceDate <= to_timestamp(final_date, 'YYYY.MM.DD')
    
    GROUP BY Artist.Name
    order by sales desc
    LIMIT results_limit;
END;
$func$  
LANGUAGE plpgsql;

--SELECT * FROM getprofitableartists('2009/1/1','2009/2/3',3);

DROP FUNCTION IF EXISTS getSalesPerGenre;
CREATE OR REPLACE FUNCTION getSalesPerGenre(initial_date TEXT, final_date TEXT)
    RETURNS TABLE ( genre VARCHAR
                    , sales INTEGER ) AS
$func$
BEGIN
    RETURN QUERY
    SELECT Genre.Name,
    COUNT(*)::INTEGER AS sales
    FROM Genre
    INNER JOIN
    Track ON Track.GenreId = Genre.GenreId
    INNER JOIN
    InvoiceLine ON InvoiceLine.TrackId = Track.TrackId
    INNER JOIN
    Invoice ON Invoice.InvoiceId = InvoiceLine.InvoiceId
    WHERE InvoiceDate >= to_timestamp(initial_date, 'YYYY.MM.DD') and InvoiceDate <= to_timestamp(final_date, 'YYYY.MM.DD')
    GROUP BY Genre.Name
    ORDER BY sales DESC;
END;
$func$  
LANGUAGE plpgsql;

--SELECT * FROM getSalesPerGenre('2009/1/28','2010/2/28');

DROP FUNCTION IF EXISTS getPlaybackRecordByArtist;
CREATE OR REPLACE FUNCTION getPlaybackRecordByArtist(artist_name TEXT)
    RETURNS TABLE ( name VARCHAR
                    , playbacks INTEGER ) AS
$func$
BEGIN
    RETURN QUERY
    SELECT Track.Name,
    COUNT(*)::INTEGER AS playbacks
    FROM Track 
    INNER JOIN
    Album ON Album.AlbumId = Track.AlbumId	
    INNER JOIN
    Artist ON Artist.ArtistId = Album.ArtistId
    INNER JOIN
    PlaybackRecord ON PlaybackRecord.TrackId = Track.TrackId
    WHERE lower(Artist.Name) like lower(artist_name) 
    GROUP BY Track.Name
    ORDER BY playbacks desc;
END;
$func$  	
LANGUAGE plpgsql;

--SELECT * FROM getPlaybackRecordByArtist('Ac/DC');


drop function if exists usersSales;
CREATE OR REPLACE FUNCTION usersSales(initial_date TEXT, final_date TEXT)
    RETURNS TABLE ( userid INTEGER
    				, invoiceid INTEGER
                    , firstname VARCHAR
				  	, lastname VARCHAR
				   	, city VARCHAR
				   	, invoicedate TIMESTAMP WITHOUT TIME ZONE
				   	, total NUMERIC) AS
$func$
BEGIN
    RETURN QUERY
	SELECT u.userid, i.invoiceid,u.firstname, u.lastname, u.city, i.invoicedate, i.total 
	FROM AppUser u 
	INNER JOIN Invoice i 
	ON u.userid = i.userid 
	WHERE i.invoicedate BETWEEN to_timestamp(initial_date, 'YYYY.MM.DD') AND to_timestamp(final_date, 'YYYY.MM.DD');    
END;
$func$  
LANGUAGE plpgsql;

-- RECOMMENDATIONS
CREATE OR REPLACE VIEW latestRegisteredSongs
AS
SELECT distinct lb.recorddate, t.trackid, t.name, a.albumid, a.title as album, ar.artistid, ar.name as artist, g.genreid, g.name as genre, t.uri FROM logbook lb
	INNER JOIN track t on lb.itemid = t.trackid
	INNER JOIN genre g on t.genreid = t.genreid 
	INNER JOIN album a on t.albumid = a.albumid 
	INNER JOIN artist ar on a.artistid = ar.artistid 
	WHERE itemid NOT IN (
	   SELECT itemid
	   FROM logbook
	   WHERE action = 'DELETE' or action = 'UPDATE'
	) and type = 'TRACK' and lb.recorddate >= date_trunc('year', now()) - interval '1 year' ORDER BY lb.recorddate desc;

-- Track recommendation based on purchased artists or genres tracks
DROP FUNCTION IF EXISTS getTrackRecommendationsByUser;
CREATE OR REPLACE FUNCTION getTrackRecommendationsByUser(user_id INT)
    RETURNS TABLE ( trackid INT, trackname VARCHAR
                    , albumtitle VARCHAR, artistname VARCHAR, genre VARCHAR, uri VARCHAR ) AS
$func$
BEGIN
    RETURN QUERY
    select distinct lrs.trackid, lrs.name, lrs.album, lrs.artist, lrs.genre, lrs.uri
    FROM latestRegisteredSongs lrs
    where lrs.genreid in (    
	    select distinct t.genreid from invoiceline il
		inner join track t on t.trackid  = il.trackid 
		inner join invoice i on il.invoiceid  = i.invoiceid
		inner join appuser au on au.userid = i.userid 
		where i.userid = user_id
	) or lrs.artistid in (
		select distinct a.artistid from invoiceline il
		inner join track t on t.trackid  = il.trackid 
		inner join album a on t.albumid  = a.albumid 
		inner join invoice i on il.invoiceid  = i.invoiceid
		inner join appuser au on au.userid = i.userid 
		where i.userid = user_id
	);
END;
$func$  	
LANGUAGE plpgsql;